import logo_stackoverflow from './logo_stackoverflow.svg';
import React from 'react';

import React_dom from 'react-dom';
import About from './components/About'
import Products from './components/Products'
import ForTeams from './components/ForTeams'

import './App.css';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function Home(){
  return(<h1>home contents</h1>);
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
      <nav>
        <Router>
        <Link to ='/'>Home</Link>
        <Link to ='./components/About'>About</Link>
        <Link to ='./components/Products'> Products</Link>
        <Link to ='./components/ForTeams'>For Teams</Link>

        <Routes>
        <Route exact path ='/' element={<Home />} />

          <Route exact path ='./components/About' element={<About/>}> </Route> 
          <Route path ='./components/Products' element = {<Products/>}></Route> 
          <Route path ='./components/ForTeams' element = {<ForTeams/>} ></Route>


        </Routes>

        </Router>
      </nav>
      </header>
    </div>
  );
}

export default App;
